import React from "react";

import ContainerMaintext from "../components/containerMainText";
import TextMain from "../components/textMain";
import Span from "../components/span";

const Main = () => {
	return (
		<ContainerMaintext>
			<TextMain>
				HOLA ,
				<br />¿<Span primary>Q</Span>UÉ
				<br />
				QUIERES
				<br />
				REGALAR <Span>?</Span>
			</TextMain>
		</ContainerMaintext>
	);
};

export default Main;
